Complete set of Doll House, season 1 &amp; 2

The show follows an organization that employs mind-wiped humans known as Dolls who are implanted with false memories and skills for various missions and tasks. When they are not 'at work' they are living in a real life Dollhouse which gives the show the name. One of those mind-wiped humans, a young woman named Echo, is slowly starting to become aware of herself and what's going on - all the while somebody on the outside is trying to bring the Dollhouse down while getting closer to Echo - possibly not aware that she is one of the Dolls he is after. Written by &lt;a class=&quot;__cf_email__&quot; href=&quot;/cdn-cgi/l/email-protection&quot; data-cfemail=&quot;1f7d737e7174407b7073736c5f7376697a75706a6d717e73317c7072&quot;&gt;[email&amp;#160;protected]&lt;/a&gt;&lt;script cf-hash='f9e31' type=&quot;text/javascript&quot;&gt;
